INSERT INTO `sennheiser-kopfhörer` (ranking, picture, name, main_url, main_price, star, review_count, highlight,detail) VALUES (6, '../img/products/Sennheiser-Kopfhörer/Sennheiser HD 599.webp;', 'Sennheiser HD 599', 'https://www.amazon.de/Sennheiser-HD-599-ohrumschlie%C3%9Fender-matt-ivory-Wei%C3%9F/dp/B01L1IICR2/ref=sr_1_4?__mk_de_DE=%C3%85M%C3%85%C5%BD%C3%95%C3%91&crid=342MCT25J6UST&keywords=Sennheiser+HD+599&qid=1667232461&qu=eyJxc2MiOiIyLjU1IiwicXNhIjoiMS41MCIsInFzcCI6IjEuMjMifQ%3D%3D&sprefix=%2Caps%2C88&sr=8-4', '134,99', 4.6, 3706, 0, '-;Sennheiser;Erwachsener;-;Ohraufliegend;-;Kabelgebunden;-;Der offene HD 599 bietet ein beeindruckendes, natürliches Raumerlebnis|Der ohrumschließende Premium-Kopfhörer ist das Topmodell der 500er-Serie von Sennheiser und bietet eine nahezu audiophile Klangqualität und ausgezeichneten Tragekomfort, durch große Hörmuscheln und weiche, erneuerbare Ohrpolster|In markantem Design-Mix aus Elfenbein und Metallic-Matt, mit braunem, genähtem Kopfband, ist er eine erstklassige Anschaffung für diejenigen, die einen anspruchsvollen Klang und ein hochwertiges Design, mit hochwertiger Konstruktion suchen|Ohrumschließender, offener Premium-Kopfhörer|Gepolstertes Kopfband und luxuriöse Ohrpolster, ideal für langes Hörvergnügen|Kabeloptionen: Steckbares, robustes 3-m-Kabel und 6,3-mm-Klinkenstecker + zusätzlich steckbares 1,2-m-Kabel mit 3,5-mm-Klinkenstecker');
INSERT INTO `sennheiser-kopfhörer` (ranking, picture, name, main_url, main_price, star, review_count, highlight,detail) VALUES (7, '../img/products/Sennheiser-Kopfhörer/Sennheiser CX Plus.webp;', 'Sennheiser CX Plus', 'https://www.amazon.de/SENNHEISER-Plus-Wireless-Bluetooth-Ear-Kopfh%C3%B6rer-Schwarz/dp/B09BB9NTXD/ref=sr_1_3?__mk_de_DE=%C3%85M%C3%85%C5%BD%C3%95%C3%91&crid=21R9LZANL1DC9&keywords=Sennheiser+CX+Plus&qid=1667232467&qu=eyJxc2MiOiIxLjk5IiwicXNhIjoiMS42MiIsInFzcCI6IjEuNjEifQ%3D%3D&sprefix=%2Caps%2C63&sr=8-3', '124,99', 4.1, 1105, 0, 'black;Sennheiser;Erwachsener;47 g;Im Ohr;Smartphone, Tablet;Kabellos;Aluminium;Erlebe herausragenden Klang ohne Kompromisse: dank der innovativen TrueResponse-Technologie von Sennheiser mit umfassender Audiocodec-Unterstützung einschließlich AAC, aptX, aptX Adaptive und SBC via Bluetooth.|Konkurrenzlose Akkulaufzeit: Bis zu 24 Stunden Musikwiedergabe dank der hochwertigen, im Lieferumfang enthaltenen Ladebox|Active Noise Cancellation und federleichtes, ergonomisches Design: Das ergonomische Design bietet höchsten Tragekomfort und die vier Ohradapter in unterschiedlichen Größen garantieren eine sichere Passform sowie hervorragende Active Noise Cancellation|Digitale Steuerung via App: Mit unserer Smart Control App für iOS und Android kannst du alle Funktionen der Ohrhörer individuell an deine Bedürfnisse und Vorlieben anpassen. Sie ermöglicht eine schnelle, stabile Bluetooth-Verbindung und überzeugt durch vielfältige Optionen für Musikwiedergabe, Anrufe sowie Konnektivität mit dem Sprachassistenten|Bass-Boost: Mit dem integrierten Equalizer kannst du einen satten, dynamischen Bass einstellen und dich vom Rhythmus mitreißen lassen. Jahrzehntelange Erfahrung hat Sennheiser zu einem einzigartigen Unternehmen gemacht, das neue Maßstäbe im Bereich der Audiotechnologie setzt|Spritzwasserschutz (IPX4): Lass dich in jeder Umgebung in eine neue Dimension des Klangs entführen|Included_Components: Kabellos Ladebehälter');
INSERT INTO `sennheiser-kopfhörer` (ranking, picture, name, main_url, main_price, star, review_count, highlight,detail) VALUES (8, '../img/products/Sennheiser-Kopfhörer/Sennheiser Momentum.webp;', 'Sennheiser Momentum', 'https://www.amazon.de/Sennheiser-MOMENTUM-Wireless-Kopfh%C3%B6rer-Bluetooth-Black/dp/B0B6GHW1SX/ref=sr_1_3?__mk_de_DE=%C3%85M%C3%85%C5%BD%C3%95%C3%91&crid=1PVBA48J5LIDY&keywords=Sennheiser+Momentum&qid=1667232473&qu=eyJxc2MiOiI0LjQzIiwicXNhIjoiNC4xNCIsInFzcCI6IjMuNjMifQ%3D%3D&sprefix=%2Caps%2C80&sr=8-3', '332,09', 3.9, 239, 0, '-;Sennheiser;Erwachsener;293 g;Ohrumschließend;-;Kabellos;-;Maximale Audioauflösung in charakteristischem Sennheiser-Klang: Genieße den ganzen Tag lang erstklassige Musikqualität - das audiophile 42-mm-Wandlersystem und aptX Adaptive machen es möglich|Klangpersonalisierung über die Sennheiser Smart Control App: Klanganpassung über integrierte Equalizer, Voreinstellungen und Klangmodi für Deine individuellen Vorlieben - für ein einzigartiges Klangerlebnis|Ungestörter Musikgenuss: Dank der adaptiven Geräuschunterdrückung kannst Du Dich ganz in die Musik vertiefen - mit dem einstellbaren Transparenzmodus nimmst Du Umgebungsgeräusche auch weiterhin wahr|Außergewöhnlicher Tragekomfort und lange Akkulaufzeit: Leichtes, faltbares Design mit gepolstertem Kopfbügel und Ohrpolstern für anhaltenden Komfort - bis zu 60 Stunden Wiedergabezeit mit Schnellladung|Kristallklare Anrufe: Die vier digitalen Beamforming-Mikrofone unterdrücken aktiv Windgeräusche, vereinfachen den Zugriff auf den Sprachassistenten und sorgen für erstklassige Gesprächsqualität|Ziel geschlecht: unisex');
